import { BrowserRouter, Routes, Route } from "react-router-dom";
import NavBar from "./NavBar";
import Homepage from "./pages/Homepage";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <NavBar/>
        <Routes>
          <Route path="/" element={<Homepage/>} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
